Information
------------------------------

Ghost Planes
At the time of this writing, Malaysia Airlines Flight 370, transporting 227 passengers and 12 crew members from Kuala Lumpur to Beijing, has been missing for months. An unprecedented international search was unable to locate any bodies or debris. Authorities remain baffled, and the world remains transfixed. However, this is not the first story of its kind to shake the global community.
According to the Aviation Society Network, more than 80 aircrafts have been declared &quot;missing&quot; since 1948, &quot;Ghost Planes&quot; that have literally vanished without a trace. This special utilizes interviews with experts and the families of passengers, CGI, re-enactments and archival news footage to walk viewers through the various theories surrounding the fate of missing Malaysian Flight 370, while discussing the disappearance in its historical context, as one of many &quot;Ghost Plane&quot; cases that have perplexed people since the beginning of aviation.

